import React, { useState, useEffect } from "react";
import {
    Paper,
    Table,
    TableBody,
    TableCell,
    TableContainer,
    TableHead,
    TableRow,
    TextField,
    TablePagination,
    Toolbar,
    Typography,
    Button,
    Dialog,
    DialogActions,
    DialogContent,
    DialogTitle,
} from "@mui/material";
import SearchIcon from "@mui/icons-material/Search";
import axios from "axios";

const API_URL = "https://localhost:44375/api/incidents";

const IncidentTable = () => {
    const [incidents, setIncidents] = useState([]);
    const [search, setSearch] = useState("");
    const [page, setPage] = useState(0);
    const [rowsPerPage, setRowsPerPage] = useState(5);
    const [open, setOpen] = useState(false);
    const [selectedIncident, setSelectedIncident] = useState(null);

    useEffect(() => {
        fetchIncidents();
    }, []);

    const fetchIncidents = async () => {
        try {
            const response = await axios.get(API_URL);
            setIncidents(response.data);
        } catch (error) {
            console.error("Error fetching incidents", error);
        }
    };

    const handleSearchChange = (event) => {
        setSearch(event.target.value);
    };

    const handlePageChange = (event, newPage) => {
        setPage(newPage);
    };

    const handleRowsPerPageChange = (event) => {
        setRowsPerPage(parseInt(event.target.value, 10));
        setPage(0);
    };

    const handleOpen = (incident) => {
        setSelectedIncident(incident);
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
        setSelectedIncident(null);
    };

    const handleDelete = async (id) => {
        try {
            await axios.delete(`${API_URL}/${id}`);
            fetchIncidents();
        } catch (error) {
            console.error("Error deleting incident", error);
        }
    };

    const filteredIncidents = incidents.filter((incident) =>
        incident.rideService.toLowerCase().includes(search.toLowerCase())
    );

    return (
        <Paper sx={{ width: "100%", overflow: "hidden", padding: 2 }}>
            <Typography variant="h6" gutterBottom>
                Ride-Sharing Incidents
            </Typography>
            <Toolbar>
                <TextField
                    variant="outlined"
                    size="small"
                    placeholder="Search by Ride Service"
                    value={search}
                    onChange={handleSearchChange}
                    sx={{ marginLeft: "auto" }}
                    InputProps={{
                        startAdornment: <SearchIcon />,
                    }}
                />
            </Toolbar>
            <TableContainer>
                <Table>
                    <TableHead>
                        <TableRow>
                            <TableCell>Ride Service</TableCell>
                            <TableCell>Driver</TableCell>
                            <TableCell>Passenger</TableCell>
                            <TableCell>Incident Type</TableCell>
                            <TableCell>Date</TableCell>
                            <TableCell>Location</TableCell>
                            <TableCell>Actions</TableCell>
                        </TableRow>
                    </TableHead>
                    <TableBody>
                        {filteredIncidents.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage).map((incident) => (
                            <TableRow key={incident.id}>
                                <TableCell>{incident.rideService}</TableCell>
                                <TableCell>{incident.driverName}</TableCell>
                                <TableCell>{incident.passengerName}</TableCell>
                                <TableCell>{incident.incidentType}</TableCell>
                                <TableCell>{new Date(incident.incidentDate).toLocaleDateString()}</TableCell>
                                <TableCell>{incident.location}</TableCell>
                                <TableCell>
                                    <Button onClick={() => handleOpen(incident)}>View</Button>
                                    <Button color="error" onClick={() => handleDelete(incident.id)}>
                                        Delete
                                    </Button>
                                </TableCell>
                            </TableRow>
                        ))}
                    </TableBody>
                </Table>
            </TableContainer>
            <TablePagination
                rowsPerPageOptions={[5, 10, 25]}
                component="div"
                count={filteredIncidents.length}
                rowsPerPage={rowsPerPage}
                page={page}
                onPageChange={handlePageChange}
                onRowsPerPageChange={handleRowsPerPageChange}
            />
            <Dialog open={open} onClose={handleClose}>
                <DialogTitle>Incident Details</DialogTitle>
                <DialogContent>
                    {selectedIncident && (
                        <div>
                            <Typography>Ride Service: {selectedIncident.rideService}</Typography>
                            <Typography>Driver: {selectedIncident.driverName}</Typography>
                            <Typography>Passenger: {selectedIncident.passengerName}</Typography>
                            <Typography>Incident Type: {selectedIncident.incidentType}</Typography>
                            <Typography>Incident Date: {new Date(selectedIncident.incidentDate).toLocaleDateString()}</Typography>
                            <Typography>Location: {selectedIncident.location}</Typography>
                            <Typography>Description: {selectedIncident.description}</Typography>
                        </div>
                    )}
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleClose}>Close</Button>
                </DialogActions>
            </Dialog>
        </Paper>
    );
};

export default IncidentTable;
